import React, { Component } from "react";
import "./App.css";
import Card from "./Card.js";
class App extends Component {
  constructor() {
    this.toggle = this.toggle.bind(this);
  }
  toggle() {}
  render() {
    const emojis = [
      "😁",
      "😂",
      "😃",
      "😄",
      "😂",
      "😃",
      "😄",
      "😅",
      "😆",
      "😅",
      "😆",
      "😁"
    ];
    const cards = emojis.map(i => {
      return <Card emoji={i} onClick={this.toggle} />;
    });
    return <div className="App">This is AIT homework 08.</div>;
  }
}

export default App;
